    true,nt"url": null,nt"notes": "The Dietary Supplement Ingredient Database
    (DSID) is a collaborative venture with the NIH Office of Dietary Supplements, the
    US Department of Agriculture and other federal agencies to provide analytically-derived
    estimates of ingredients in dietary supplements. Release 2 of the DSID reports national
    estimates for vitamins and minerals in adult and children's multivitamins (MVMs)
    ( http://dsid.usda.nih.gov).  For the DSID studies, representative supplement products
    are identified, sampled and analyzed by experienced laboratories. In order to obtain
    accurate results, a quality assurance and quality control plan are established for
    each study, with standard reference materials, in-house control materials and product
    duplicate results assessed before product data are accepted as final.  Laboratory
    data are then statistically evaluated by ingredient and weighted by market share
    information, if available. For the MVM studies released in DSID-2, data are reported
    by ingredient across a range of labeled levels.  Results are predicted by regression
    and estimate mean percent differences from label and standard errors at these labeled
    levels. These data can be used by researchers to more accurately quantify nutrient
    intake from dietary supplements.",nt"license_title": "Creative Commons Attribution",nt"extras":
